INSERT INTO `query_qry` (`qry_ID`, `qry_SQL`, `qry_Name`, `qry_Description`, `qry_Count`) VALUES
(2, 'SELECT COUNT(per_ID)\r\nAS ''Jumlah''\r\nFROM person_per', 'Total Jumlah Jiwa', 'Menampikan Total Jumpah Jiwa dalam database', 0),
(3, 'SELECT CONCAT(''<a href=FamilyView.php?FamilyID='',fam_ID,''>'',fam_Name,''</a>'') AS ''Nama Keluarga'', COUNT(*) AS ''Jumlah.''\r\nFROM person_per\r\nINNER JOIN family_fam\r\nON fam_ID = per_fam_ID\r\nGROUP BY per_fam_ID\r\nORDER BY ''No.'' DESC', '3. Jumlah Jiwa Dalam Keluarga', 'Data Jumlah Jiwa yang terdaftar dalam suatu Keluarga', 0),
(4, 'SELECT a.per_ID as ID, CONCAT(a.per_FirstName,'' '',a.per_MiddleName) AS Nama,IF(a.per_Gender=1,"L","P") as Gender, \r\nCONCAT(a.per_BirthDay,''/'',a.per_BirthMonth,''/'',a.per_BirthYear) AS ''Tanggal Lahir'',\r\nYEAR(CURRENT_DATE) - a.per_BirthYear - 1 AS ''Umur''\r\n, c.fam_homephone as TelpRumah, b.c13 as TelpKantor, a.per_cellphone as Handphone, a.per_workphone AS ''Kelompok''\r\nFROM person_per a, person_custom b, family_fam c\r\nWHERE\r\na.per_id = b.per_id\r\nAND\r\na.per_fam_id = c.fam_id\r\nAND\r\nDATE_ADD(CONCAT(a.per_BirthYear,''-'',a.per_BirthMonth,''-'',a.per_BirthDay),INTERVAL\r\n~min~ YEAR) <= CURDATE()\r\nAND\r\nDATE_ADD(CONCAT(a.per_BirthYear,''-'',a.per_BirthMonth,''-'',a.per_BirthDay),INTERVAL\r\n(~max~ + 1) YEAR) >= CURDATE()\r\norder by\r\na.per_workphone', '4. Jemaat Berdasarkan Rentang Umur', 'Menampilkan Data Jemaat Berdasarkan Rentang Umur', 1),
(6, 'SELECT COUNT(per_ID) AS Total FROM person_per WHERE per_Gender = ~gender~', 'Jumlah Total per Jenis Kelamin', 'Menampilkan Jumlah Total per Jenis Kelamin', 0),
(7, 'SELECT per_ID as AddToCart, CONCAT(per_FirstName,'' '',per_MiddleName,'' '',per_LastName) AS Nama FROM person_per WHERE per_fmr_ID = ~role~ AND per_Gender = ~gender~', '5. Jemaat Berdasarkan Peran dan Jenis Kelamin', 'Data Jemaat berdasarkan Peran dalam Keluarga dan Jenis Kelamin', 1),
(15, 'SELECT per_ID as AddToCart, CONCAT(''<a href=PersonView.php?PersonID='',per_ID,''>'',per_FirstName,'' '',per_MiddleName,'' '',per_LastName,''</a>'') AS Nama, fam_City as Kota, fam_State as Daerah, fam_Zip as KodePOS, per_HomePhone as TelephoneRumah, per_Email as Email  FROM person_per RIGHT JOIN family_fam ON family_fam.fam_id = person_per.per_fam_id WHERE ~searchwhat~ LIKE ''%~searchstring~%''', '1. Lacak', 'Mencari data berdasarkan Nama, Kota, Daerah, Kode POS, Telepon Rumah, Email atau tempat lahir\r\n', 1),
(52, 'select c.lst_OptionName as GolonganDarah, count(a.per_ID) as Jumlah	from person_per a , person_custom b , list_lst c\r\nWHERE a.per_ID = b.per_ID AND b.c6 = c.lst_OptionID AND c.lst_ID = 20\r\nGROUP BY c.lst_OptionName', 'Golongan Darah Jemaat', 'Golongan Darah Jemaat', 0),
(53, 'select c.lst_OptionName as GolonganDarah, a.per_FirstName as Nama , per_WorkPhone as Kelompok from person_per a , person_custom b , list_lst c\r\nWHERE a.per_ID = b.per_ID AND b.c6 = c.lst_OptionID AND c.lst_ID = 20\r\nORDER BY c.lst_OptionName, per_Workphone, per_FirstName', 'Golongan Darah Detail', 'Golongan Darah Detail', 0),
(54, 'select per_WorkPhone as Kelompok, c.lst_OptionName as GolonganDarah, a.per_FirstName as Nama   from person_per a , person_custom b , list_lst c\r\nWHERE a.per_ID = b.per_ID AND b.c6 = c.lst_OptionID AND c.lst_ID = 20\r\nORDER BY per_WorkPhone', 'Golongan Darah Per Kelompok', 'Golongan Darah Per Kelompok', 0),
(18, 'SELECT per_BirthDay as Hari,per_BirthMonth as Bulan, per_BirthYear as Tahun ,per_FirstName AS Nama, per_WorkPhone AS Kelompok FROM person_per WHERE per_cls_ID=1 AND per_BirthMonth=~birthmonth~ ORDER BY per_BirthDay, per_WorkPhone', '2. Ulang Tahun', 'Jemaat yang berulang Tahun pada bulan spesifik', 0),
(51, 'select b.grp_name as Kelompok, count(a.p2g2r_grp_id) as Anggota  from person2group2role_p2g2r a, group_grp b, person_per c\r\nwhere a.p2g2r_grp_id = b.grp_id AND a.p2g2r_per_id = c.per_ID\r\ngroup by b.grp_id order by b.grp_id', 'Jumlah Anggota Dalam Kelompok', 'Menghitung Jumlah Anggota dalam Kelompok', 0),
(55, 'SELECT CONCAT(''<a href=PersonView.php?PersonID='',per_ID,''>'',per_FirstName,''</a>'') AS ''Nama '', per_WorkPhone as Kelompok, per_DateLastEdited as "TGL Edit", per_DateEntered "TGL Input", per_EnteredBy as "DiInput oleh", per_EditedBy as "DiEdit oleh"  FROM `person_per` ORDER by per_DateLastEdited desc LIMIT 0,20', 'Data Individu yang Di Edit Paling Akhir', 'Data Individu yang Di Edit Paling Akhir diurutkan berdasar khan tanggal Edit Terakhir', 0),
(56, 'SELECT CONCAT(''<a href=FamilyView.php?FamilyID='',fam_ID,''>'',fam_Name,''</a>'') AS ''Nama Keluarga'', fam_WorkPhone as Kelompok, fam_DateLastEdited as "TGL Edit", fam_DateEntered "TGL Input", fam_EnteredBy as "DiInput oleh", fam_EditedBy as "DiEdit oleh"  FROM `family_fam` ORDER by fam_DateLastEdited desc LIMIT 0,20', 'Data Keluarga yang Di Edit Paling Akhir', 'Data Keluarga yang Di Edit Paling Akhir di urutkan berdasarkan Tanggal Edit', 0),
(57, 'SELECT CONCAT(''<a href=PersonView.php?PersonID='',per_ID,''>'',per_FirstName,''</a>'') AS ''Nama '', per_WorkPhone as Kelompok,per_BirthDay as TGL, per_BirthMonth as BLN, per_BirthYear as TAHUN, per_cls_ID as Status,   per_DateLastEdited as "TGL Edit", per_DateEntered "TGL Input", per_EnteredBy as "DiInput oleh", per_EditedBy as "DiEdit oleh"  FROM `person_per`where ( per_cls_ID = 1 OR per_cls_ID = 2 ) AND (per_BirthDay = 00 or per_BirthMonth = 00 or per_BirthYear = 0000)', '<font color="red">Error - Data Tidak Lengkap - Tanggal Lahir</font>', 'Data warga yang Data tanggal Lahirnya Tidak Lengkap', 0),
(58, 'SELECT CONCAT(''<a href=PersonView.php?PersonID='',per_ID,''>'',per_FirstName,''</a>'') AS ''Nama '', per_WorkPhone AS Kelompok, per_DateLastEdited as "TGL Edit", per_DateEntered "TGL Input", per_EnteredBy as "DiInput oleh", per_EditedBy as "DiEdit oleh"\r\nFROM person_per\r\nNATURAL JOIN person_custom\r\nWHERE c6 IS NULL order by per_FirstName', '<font color="red">Error - Data Tidak Lengkap - Golongan Darah</font>', 'Data warga yang belum memasukkan Data Golongan Darah', 0),
(59, 'SELECT CONCAT(''<a href=PersonView.php?PersonID='',per_ID,''>'',per_FirstName,''</a>'') AS ''Nama '', per_WorkPhone AS Kelompok, per_DateLastEdited as "TGL Edit", per_DateEntered "TGL Input", per_EnteredBy as "DiInput oleh", per_EditedBy as "DiEdit oleh"\r\nFROM person_per\r\nWHERE per_WorkPhone is null or per_workphone ='' ''', '<font color="red">Error - Data Tidak Lengkap - Kelompok</font>', 'Data Warga yang belum masuk dalam kelompk tertentu', 0),
(60, 'SELECT CONCAT(''<a href=PersonView.php?PersonID='',per_ID,''>'',per_FirstName,''</a>'') AS ''Nama '', per_WorkPhone as Kelompok, c1 as TglBaptisAnak, c2 as TglSidhi, c18 as TglBaptisDewasa , per_DateLastEdited as "TGL Edit", per_DateEntered "TGL Input", per_EnteredBy as "DiInput oleh", per_EditedBy as "DiEdit oleh" FROM person_per NATURAL JOIN person_custom \r\nwhere \r\n(c1 is null or c1=''0000-00-00'' ) and \r\n(c26 is null or c26=''0000-00-00'' )and \r\n(c2 is null or c2=''0000-00-00'' ) and \r\n(c27 is null or c27=''0000-00-00'' )and \r\n(c18 is null or c18=''0000-00-00'' ) and \r\n(c28 is null or c28=''0000-00-00'' )\r\norder by per_workphone, per_FirstName', 'Warga yang Belum BAPTIS KECIL/DEWASA dan SIDHI', 'Warga yang Belum BAPTIS KECIL/DEWASA dan SIDHI', 0),
(61, 'select per_workphone as Kelompok, lst_optionName as Status, count(per_fmr_id) as Jumlah  from person_per, list_lst \r\nwhere lst_id = 2 AND per_fmr_id = lst_optionid\r\ngroup by per_fmr_id, per_workphone order by per_workphone, per_fmr_id', 'Status Keluarga Per Kelompok', 'Data Jumlah warga di kelompokkan berdasar Status di Keluarga dan Kelompok', 0),
(62, 'select CONCAT(''<a href=PersonView.php?PersonID='',per_ID,''>'',per_FirstName,''</a>'') AS ''Nama '',  per_workphone as Kelompok, per_fmr_id as Status \r\n,per_DateLastEdited as "TGL Edit", per_DateEntered "TGL Input", per_EnteredBy as "DiInput oleh", per_EditedBy as "DiEdit oleh"\r\nfrom person_per \r\n\r\nwhere per_fmr_id = 0 or per_fmr_id is NULL\r\n', '<font color="red">Error - Data Tidak Lengkap - Status Keluarga</font>', 'Data warga yang tidak lengkap pada Status keluarganya', 0),
(63, 'select CONCAT(''<a href=PersonView.php?PersonID='',per_ID,''>'',per_FirstName,''</a>'') AS ''Nama '',per_workphone as Kelompok, \r\nper_membershipdate as TglDaftar, IF(c1=''0000-00-00 00:00:00'',''-'',c1) as TglBaptisAnak, \r\nIF(c26 is NULL,''-'',c26) as TmpBaptisAnak, IF(c2=''0000-00-00 00:00:00'',''-'',c2) as TglSidhi, \r\nIF(c27 is NULL,''-'',c27) as TmpSidhi, IF(c18=''0000-00-00 00:00:00'',''-'',c18) as TglBaptisDewasa, \r\nIF(c28 is NULL,''-'',c28) as TmpBaptisDewasa \r\nfrom person_per natural join person_custom \r\nwhere c26 = "GKJ Bekasi" or c27 = "GKJ Bekasi" or c28 = "GKJ Bekasi"\r\norder by per_workphone, per_FirstName', 'Baptis dan Sidi', 'Daftar Jemaat yang Baptis (Anak&Dewasa) maupun Sidhi di GKJ Bekasi\r\n', 0),
(64, 'select CONCAT(''<a href=PersonView.php?PersonID='',per_ID,''>'',per_FirstName,''</a>'') AS \r\n''Nama '', per_workphone as Kelompok, c15 as StatusKawin from person_per natural join person_custom where c15 = 0 ', '<font color="red">Error - Data Tidak Lengkap - Status Perkawinan</font>', 'Data Warga yang tidak lengkap / tidak diketahui status perkawinannya', 0),
(65, 'select CONCAT(''<a href=PersonView.php?PersonID='',per_ID,''>'',per_FirstName,''</a>'') AS \r\n''Nama '', per_workphone as Kelompok, per_membershipdate as TanggalDaftar from person_per where per_membershipdate = "" or per_membershipdate is NULL', '<font color="red">Error - Data Tidak lengkap - Tanggal Daftar / Masuk</font>', 'Data warga yang tidak lengkap pada Tanggal Daftar atau data atestasi masuk.', 0),
(66, 'select CONCAT(''<a href=PersonView.php?PersonID='',per_ID,''>'',per_FirstName,''</a>'') AS \r\n''Nama '', per_workphone as Kelompok, c1 as TglBaptisAnak, c26 as TmpBaptisAnak, c2 as TglSidhi, c27 as TmpSidhi, c18 as TglBpatisDewasa, c28 as TmpBaptisDewasa,  per_membershipdate as TanggalDaftar, c8 as PindahanDari from person_per natural join person_custom where c8 <> "" or c26 <> "GKJ Bekasi" or c27 <> "GKJ Bekasi" or c28 <> "GKJ Bekasi"', 'Jemaat Pindahan', 'Daftar Jemaat Pindahan dari gereja Tertentu', 0),
(67, 'select CONCAT(''<a href=PersonView.php?PersonID='',per_ID,''>'',per_FirstName,''</a>'') AS ''Nama '',per_workphone as Kelompok,\r\nper_membershipdate as TglDaftar,\r\nIF (per_Gender=''1'',''L'',''P'') as JnKelamin,\r\nIF(c1=''0000-00-00 00:00:00'',''-'',c1) as TglBaptisAnak,\r\nIF(c26 is NULL,''-'',c26) as TmpBaptisAnak, IF(c2=''0000-00-00 00:00:00'',''-'',c2) as TglSidhi,\r\nIF(c27 is NULL,''-'',c27) as TmpSidhi, IF(c18=''0000-00-00 00:00:00'',''-'',c18) as TglBaptisDewasa,\r\nIF(c28 is NULL,''-'',c28) as TmpBaptisDewasa\r\nfrom person_per natural join person_custom\r\nwhere  c15=''1'' AND ( per_cls_id = ''1'' OR per_cls_id = ''2'') AND ( ( c2 =''0000-00-00 00:00:00'' OR c2 is NULL ) AND ( c18 =''0000-00-00 00:00:00'' OR c18 is NULL ) AND c28 is NULL AND c27 is NULL )\r\norder by per_workphone, per_FirstName', 'Data Warga Anak', 'Data Warga Anak, yang belum Baptis Dewasa atau Sidhi\r\n', 0),
(68, 'select per_id as Kode, CONCAT(''<a href=PersonView.php?PersonID='',per_ID,''>'',per_FirstName,''</a>'') AS ''Nama '',per_workphone as Kelompok,\r\nper_membershipdate as TglDaftar,\r\nIF (per_Gender=''1'',''L'',''P'') as Gender,\r\nIF (c15=''2'',''Menikah'',''-'') as Status,\r\nIF(c2=''0000-00-00 00:00:00'',''-'',c2) as TglSidhi,\r\nIF(c27 is NULL,''-'',c27) as TmpSidhi, IF(c18=''0000-00-00 00:00:00'',''-'',c18) as TglBaptisDewasa,\r\nIF(c28 is NULL,''-'',c28) as TmpBaptisDewasa\r\nfrom person_per natural join person_custom \r\nwhere ( (c2 is not NULL AND c2<>''0000-00-00 00:00:00'') \r\nAND c27 is not NULL ) \r\nOR ( (c18 is not NULL AND c18<>''0000-00-00 00:00:00'') AND c28 is not NULL) OR c15 = 2\r\norder by per_workphone, per_FirstName', 'Data Warga Dewasa Total', 'Data Warga Dewasa, yang sudah Sidhi atau Baptis Dewasa atau yang sudah berstatus Menikah', 0),
(69, 'select CONCAT(''<a href=PersonView.php?PersonID='',per_ID,''>'',per_FirstName,''</a>'') AS ''Nama '',per_workphone as Kelompok, \r\nper_membershipdate as TglDaftar, \r\nIF (per_Gender=''1'',''L'',''P'') as JnKelamin,\r\nIF(c1=''0000-00-00 00:00:00'',''-'',c1) as TglBaptisAnak, \r\nIF(c26 is NULL,''-'',c26) as TmpBaptisAnak, \r\nIF(c2=''0000-00-00 00:00:00'',''-'',c2) as TglSidhi, \r\nIF(c27 is NULL,''-'',c27) as TmpSidhi, IF(c18=''0000-00-00 00:00:00'',''-'',c18) as TglBaptisDewasa, \r\nIF(c28 is NULL,''-'',c28) as TmpBaptisDewasa \r\nfrom person_per natural join person_custom \r\nwhere \r\nYEAR(c1) = ( SELECT YEAR(CURRENT_DATE)) OR \r\nYEAR(c2) = ( SELECT YEAR(CURRENT_DATE)) OR \r\nYEAR(c18) = ( SELECT YEAR(CURRENT_DATE))\r\norder by per_workphone, per_FirstName', 'Kegiatan Baptis/Sidhi Tahun Ini', 'Kegiatan Baptis/Sidhi Tahun Ini', 0),
(70, 'select CONCAT(''<a href=PersonView.php?PersonID='',per_ID,''>'',per_FirstName,''</a>'') AS ''Nama '',per_workphone as Kelompok, \r\nper_membershipdate as TglDaftar, \r\nIF (per_Gender=''1'',''L'',''P'') as JnKelamin,\r\nIF(c1=''0000-00-00 00:00:00'',''-'',c1) as TglBaptisAnak, \r\nIF(c26 is NULL,''-'',c26) as TmpBaptisAnak, \r\nIF(c2=''0000-00-00 00:00:00'',''-'',c2) as TglSidhi, \r\nIF(c27 is NULL,''-'',c27) as TmpSidhi, IF(c18=''0000-00-00 00:00:00'',''-'',c18) as TglBaptisDewasa, \r\nIF(c28 is NULL,''-'',c28) as TmpBaptisDewasa \r\nfrom person_per natural join person_custom \r\nwhere \r\nYEAR(c1) = ( SELECT YEAR(CURRENT_DATE)-1) OR \r\nYEAR(c2) = ( SELECT YEAR(CURRENT_DATE)-1) OR \r\nYEAR(c18) = ( SELECT YEAR(CURRENT_DATE)-1)\r\norder by per_workphone, per_FirstName', 'Kegiatan Baptis/Sidhi 1 Tahun lalu', 'Kegiatan Baptis/Sidhi 1 Tahun lalu', 0),
(71, 'select CONCAT(''<a href=PersonView.php?PersonID='',per_ID,''>'',per_FirstName,''</a>'') AS ''Nama '',\r\nper_workphone as Kelompok,\r\nIF (per_Gender=''1'',''L'',''P'') as JnKelamin,\r\nper_fmr_ID as StKeluarga,\r\nper_membershipdate as TglDaftar, c8 as AttestasiDari,\r\nCONCAT(''<a href=FamilyView.php?FamilyID='',per_fam_ID,''>'',fam_Name,''</a>'') AS ''NmKeluarga ''\r\nfrom person_per natural join person_custom\r\nleft join family_fam ON person_per.per_fam_ID = family_fam.fam_ID\r\nwhere c8 is not null AND per_cls_id = 1 AND\r\nYEAR(per_membershipdate) = ( SELECT YEAR(CURRENT_DATE))\r\norder by per_workphone, per_FirstName', 'Kegiatan Attestasi Masuk Tahun Ini', 'Kegiatan Attestasi Masuk Tahun Ini', 0),
(72, 'select CONCAT(''<a href=PersonView.php?PersonID='',per_ID,''>'',per_FirstName,''</a>'') AS ''Nama '',\r\nper_workphone as Kelompok, \r\nIF (per_Gender=''1'',''L'',''P'') as JnKelamin,\r\nper_fmr_ID as StKeluarga, \r\nper_membershipdate as TglDaftar, c8 as AttestasiDari,\r\nCONCAT(''<a href=FamilyView.php?FamilyID='',per_fam_ID,''>'',fam_Name,''</a>'') AS ''NmKeluarga ''\r\nfrom person_per natural join person_custom \r\nleft join family_fam ON person_per.per_fam_ID = family_fam.fam_ID \r\nwhere c8 is not null AND  per_cls_id = 1 AND\r\nYEAR(per_membershipdate) = ( SELECT YEAR(CURRENT_DATE)-1) \r\norder by per_workphone, per_FirstName', 'Kegiatan Attestasi Masuk 1 Tahun Lalu', 'Kegiatan Attestasi Masuk 1 Tahun Lalu', 0),
(73, 'select CONCAT(''<a href=PersonView.php?PersonID='',per_ID,''>'',per_FirstName,''</a>'') AS ''Nama '',\r\nper_workphone as Kelompok, \r\nIF (per_Gender=''1'',''L'',''P'') as JnKelamin,\r\nper_fmr_ID as StKeluarga, \r\nper_membershipdate as TglDaftar, c9 as PindahKe, c10 as TglPindah,\r\nCONCAT(''<a href=FamilyView.php?FamilyID='',per_fam_ID,''>'',fam_Name,''</a>'') AS ''NmKeluarga ''\r\nfrom person_per natural join person_custom \r\nleft join family_fam ON person_per.per_fam_ID = family_fam.fam_ID \r\nwhere c9 is not null AND\r\nYEAR(c10) = ( SELECT YEAR(CURRENT_DATE)) \r\norder by per_workphone, per_FirstName', 'Kegiatan Attestasi Keluar Tahun Ini', 'Kegiatan Attestasi Keluar Tahun Ini', 0),
(74, 'select CONCAT(''<a href=PersonView.php?PersonID='',per_ID,''>'',per_FirstName,''</a>'') AS ''Nama '',\r\nper_workphone as Kelompok, \r\nIF (per_Gender=''1'',''L'',''P'') as JnKelamin,\r\nper_fmr_ID as StKeluarga, \r\nper_membershipdate as TglDaftar, c9 as PindahKe, c10 as TglPindah,\r\nCONCAT(''<a href=FamilyView.php?FamilyID='',per_fam_ID,''>'',fam_Name,''</a>'') AS ''NmKeluarga ''\r\nfrom person_per natural join person_custom \r\nleft join family_fam ON person_per.per_fam_ID = family_fam.fam_ID \r\nwhere c9 is not null AND\r\nYEAR(c10) = ( SELECT YEAR(CURRENT_DATE)-1) \r\norder by per_workphone, per_FirstName', 'Kegiatan Attestasi Keluar 1 Tahun Lalu', 'Kegiatan Attestasi Keluar 1 Tahun Lalu', 0),
(50, 'SELECT CONCAT(''<a href=PersonView.php?PersonID='',per_ID,''>'',per_FirstName,''</a>'') AS ''Nama '', per_WorkPhone AS Kelompok,\r\nper_cls_ID as Status, per_DateLastEdited as "TGL Edit", per_DateEntered "TGL Input", per_EnteredBy as "DiInput oleh", per_EditedBy as "DiEdit oleh"\r\nFROM person_per\r\nNATURAL JOIN person_custom\r\nWHERE per_cls_ID = 0 OR per_cls_ID IS NULL order by per_workphone, per_FirstName', '<font color="red">Error - Data Tidak Lengkap - Status Kewargaan</font>', 'Data warga yang Tidak Lengkap Status Kewargaannya', 0),
(48, 'select CONCAT(''<a href=PersonView.php?PersonID='',per_ID,''>'',per_FirstName,''</a>'') AS ''Nama '', per_workphone as Kelompok, per_fmr_id as Status\r\n,per_DateLastEdited as "TGL Edit", per_DateEntered "TGL Input", per_EnteredBy as "DiInput oleh", per_EditedBy as "DiEdit oleh"\r\nfrom person_per\r\n\r\nwhere per_dateLastEdited is NULL or per_dateLastEdited = 0000-00-00\r\norder by per_workphone, per_firstname', 'Data Individu yang belum pernah di edit', 'Data Individu yang belum pernah di edit sama sekali', 0),
(49, 'select CONCAT(''<a href=FamilyView.php?FamilyID='',fam_ID,''>'',fam_Name,''</a>'') AS ''Nama Keluarga '', fam_workphone as Kelompok\r\n,fam_DateLastEdited as "TGL Edit", fam_DateEntered "TGL Input", fam_EnteredBy as "DiInput oleh", fam_EditedBy as "DiEdit oleh"\r\nfrom family_fam\r\n\r\nwhere fam_dateLastEdited is NULL or fam_dateLastEdited = 0000-00-00\r\norder by fam_workphone, fam_name', 'Data Keluarga yang belum pernah di edit', 'Data Keluarga yang belum pernah di edit sama sekali', 0),
(47, 'SELECT t1.fam_id, \r\nCONCAT(''<a href=PersonView.php?PersonID='',t2.per_ID,''>'',t2.per_FirstName,''</a>'') AS ''Nama Suami'',\r\nIF(t4.c15=0,''Tidak Ada Data'',''Kawin'') as status_Suami,t4.c15,\r\nCONCAT(''<a href=PersonView.php?PersonID='',t3.per_ID,''>'',t3.per_FirstName,''</a>'') AS ''Nama Istri'',\r\nIF(t5.c15=0,''Tidak Ada Data'',''Kawin'') as status_istri,t5.c15\r\n  FROM family_fam AS t1 \r\nINNER JOIN person_per AS t2 ON ( t1.fam_id = t2.per_fam_id AND t2.per_fmr_id = 1)\r\nINNER JOIN person_per AS t3 ON ( t1.fam_id = t3.per_fam_id AND t3.per_fmr_id = 2)\r\nINNER JOIN person_custom AS t4 ON ( t4.per_id = t2.per_id )\r\nINNER JOIN person_custom AS t5 ON ( t5.per_id = t3.per_id )\r\nWhere t4.c15 <> 2 or t5.c15 <> 2\r\norder by fam_id', '<font color="red">Error - Data Tidak Lengkap - Status Perkawinan (Suami/Istri)</font>', 'Data warga (Pasangan Suami Istri) yang Status Perkawinanya tidak lengkap', 0),
(46, 'SELECT count, date as Tanggal, \r\nCONCAT(''<a href=PersonView.php?PersonID='',userid,'' target=_blank >'',userid,''</a>'') AS ''ID Pengguna'',\r\nCONCAT(''<a href=PersonView.php?PersonID='',t1.per_ID,'' target=_blank >'',t1.per_ID,''</a>'') AS ''ID Jemaat'',\r\nCONCAT(''<a href=FamilyView.php?FamilyID='',t1.fam_ID,'' target=_blank >'',t1.fam_ID,''</a>'') AS ''ID Keluarga'',\r\n var1 as "Tipe Akses"\r\nfrom logger as t1\r\norder by count desc limit 100', '<font color="blue">Logger - Laporan Akses Data Lengkap oleh Admin</font>', 'Laporan Akses Data Lengkap oleh Admin lengkap', 0),
(80, 'select CONCAT(''<a href=PersonView.php?PersonID='',per_ID,''>'',per_FirstName,''</a>'') AS ''Nama '', \r\nCONCAT(''<a href=FamilyView.php?FamilyID='',per_fam_id,''>'',fam_name,''</a>'')  as Nama_Keluarga\r\n,per_workphone as Kelompok,per_lastname as Stambuk, lst_OptionName as Ket\r\n\r\nfrom person_per, family_fam, list_lst\r\nwhere per_fam_id = fam_id AND per_lastname ='''' AND lst_ID =1 and per_cls_id = lst_OptionID\r\norder by per_workphone, per_fam_id, per_firstname', 'Error : Data Warga Yang tidak ada no Stambuk dr GKJ Bekasi', 'Data Warga Yang tidak ada no Stambuk dr GKJ Bekasi.', 0),
(81, 'select stambuk.stambuk as NoStambuk, stambuk.nama as Nama, gender , namaortu as NamaOrangTua,\r\ntempatlahir as TempatLahir, tgllahir as Tgl, blnlahir as Bln, thnlahir As Thn,\r\nstambuk.kelompok as Kelompok, stambuk.ket2 as Wilayah, keterangan\r\nfrom stambuk\r\nleft join person_per\r\non person_per.per_lastname = stambuk.stambuk\r\nwhere person_per.per_lastname IS NULL AND stambuk.ket2 like ''%TIMUR%''\r\nAND stambuk.keterangan = ''''\r\norder by stambuk.kelompok, stambuk.namaortu,stambuk.nama', '<font color="magenta">Error : Data Stambuk, yang belum ada korelasi dengan datawarga GKJ Wil Timur</font>', 'Data Stambuk, yang belum ada korelasi dengan datawarga GKJ Wil Timur', 0),
(83, 'select * from stambuk where ket2 like ''%TIMUR%'' order by kelompok, stambuk', '<font color="magenta">Data Warga Wilayah Timur dari Stambuk GKJ Bekasi</font>', 'select * from stambuk where ket2 like ''%TIMUR%'' order by kelompok, stambuk', 0),
(85, 'select CONCAT(''<a href=PersonView.php?PersonID='',a.per_ID,''>'',a.per_FirstName,''</a>'') AS ''Nama '',\r\nfam_homephone as TelpRumah, c13 as TelpKantor, per_cellphone as Handphone, per_email as Email, vol_name as Jabatan, per_workphone as Kelompok\r\nfrom person_per a, person_custom b, family_fam, person2volunteeropp_p2vo, volunteeropportunity_vol\r\nwhere a.per_id = b.per_id AND\r\na.per_id = p2vo_per_id AND p2vo_vol_id = vol_id AND per_fam_id = fam_id AND vol_id < 4\r\nORDER by vol_id, per_workphone, per_firstname\r\n', '<font color="green">Struktur Organisasi Kemajelisan</font>', 'Struktur Organisasi Kemajelisan', 0),
(86, 'select CONCAT(''<a href=PersonView.php?PersonID='',a.per_ID,''>'',a.per_FirstName,''</a>'') AS ''Nama '',\r\nfam_homephone as TelpRumah, c13 as TelpKantor, per_cellphone as Handphone, per_email as Email, vol_name as Jabatan, per_workphone as Kelompok\r\nfrom person_per a, person_custom b, family_fam, person2volunteeropp_p2vo, volunteeropportunity_vol\r\nwhere a.per_id = b.per_id AND\r\na.per_id = p2vo_per_id AND p2vo_vol_id = vol_id AND per_fam_id = fam_id\r\n AND vol_id > 7 \r\nORDER by vol_id, per_workphone, per_firstname\r\n', '<font color="green">Struktur Organisasi Badan Pembantu Majelis</font>', 'Struktur Organisasi Badan Pembantu Majelis', 0),
(87, 'select CONCAT(''<a href=PersonView.php?PersonID='',a.per_ID,''>'',a.per_FirstName,''</a>'') AS ''Nama '',\r\nfam_homephone as TelpRumah, c13 as TelpKantor, per_cellphone as Handphone, per_email as Email, vol_name as Jabatan, per_workphone as Kelompok\r\nfrom person_per a, person_custom b, family_fam, person2volunteeropp_p2vo, volunteeropportunity_vol\r\nwhere a.per_id = b.per_id AND\r\na.per_id = p2vo_per_id AND p2vo_vol_id = vol_id AND per_fam_id = fam_id\r\n AND vol_id > 3 AND vol_id < 8\r\nORDER by per_workphone, vol_id, per_firstname\r\n', '<font color="green">Struktur Organisasi Pengurus kelompok</font>', 'Struktur Organisasi Pengurus kelompok', 0),
(88, 'select per_id as ID, per_fam_id as IDKelg, per_firstname as Nama_Lengkap, per_gender as Gender, per_fmr_id as StKelg, \r\nfam_name as NamaKeluarga, \r\nper_birthday as Tgl, per_birthmonth as Bln, per_birthyear as Thn, per_lastname as Stambuk, per_cls_id as Klas, \r\nper_workphone as Kelompok \r\nfrom person_per, family_fam\r\nwhere per_fam_id = fam_id AND per_lastname = " " \r\norder by per_workphone, per_fam_id, per_fmr_id', '<font color="magenta">Data Warga Wilayah Timur yang belum ada Nomor  Stambuk dari GKJ Bekasi</font>', 'select per_id as ID, per_fam_id as IDKelg, per_firstname as Nama_Lengkap, per_gender as Gender, per_fmr_id as StKelg, \r\nfam_name as NamaKeluarga, \r\nper_birthday as Tgl, per_birthmonth as Bln, per_birthyear as Thn, per_lastname as Stambuk, per_cls_id as Klas, \r\nper_workphone as Kelompok \r\nfrom person_per, family_fam\r\nwhere per_fam_id = fam_id AND per_lastname = " " \r\norder by per_workphone, per_fam_id, per_fmr_id', 0),
(89, 'select CONCAT(''<a href=PersonView.php?PersonID='',per_ID,''>'',per_FirstName,''</a>'') AS ''Nama '',per_workphone as Kelompok,\r\nper_membershipdate as TglDaftar,\r\nIF (per_Gender=''1'',''L'',''P'') as JnKelamin,\r\nIF(c1=''0000-00-00 00:00:00'',''-'',c1) as TglBaptisAnak,\r\nIF(c26 is NULL,''-'',c26) as TmpBaptisAnak,\r\nIF(c2=''0000-00-00 00:00:00'',''-'',c2) as TglSidhi,\r\nIF(c27 is NULL,''-'',c27) as TmpSidhi, IF(c18=''0000-00-00 00:00:00'',''-'',c18) as TglBaptisDewasa,\r\nIF(c28 is NULL,''-'',c28) as TmpBaptisDewasa\r\nfrom person_per natural join person_custom\r\nwhere\r\nc26 like ''%GKJ Bekasi%'' OR\r\nc27  like ''%GKJ Bekasi%'' OR\r\nc28 like ''%GKJ Bekasi%''\r\ngroup by\r\nper_membershipdate \r\norder by per_membershipdate desc, per_workphone, per_FirstName', 'Kegiatan Detail Baptis dan Sidhi', 'Kegiatan Detail Baptis dan Sidhi yang dilaksanakan di GKJ Bekasi atau GKJ Bekasi Wil Timur', 0),
(90, 'select YEAR(per_membershipdate) as "Didaftar Tahun", IF (per_Gender=''1'',''LakiLaki'',''Perempuan'') as JnKelamin, count(*) as Jumlah\r\nfrom person_per\r\ngroup by per_gender,YEAR(per_membershipdate)\r\norder by YEAR(per_membershipdate) desc,per_gender', 'Data Registrasi Jemaat Per Tahun', 'Data Registrasi Jemaat Per Tahun', 0),
(91, 'select CONCAT(''<a href=PersonView.php?PersonID='',per_ID,''>'',per_FirstName,''</a>'') AS ''Nama '',\r\nCONCAT(''<a href=FamilyView.php?FamilyID='',per_fam_ID,''>'',fam_name,''</a>'') AS ''Keluarga'',\r\nper_workphone as Kelompok,\r\nper_membershipdate as TglDaftar,\r\nper_BirthDay as TGL, per_BirthMonth as BLN, per_BirthYear as TAHUN, \r\nIF (per_Gender=''1'',''L'',''P'') as JnKelamin,\r\nIF(c41=''0000-00-00 00:00:00'',''-'',c41) as TglMeninggal,\r\nIF(c42 is NULL,''-'',c42) as TmpSemayam\r\nfrom person_per natural join person_custom, family_fam\r\nwhere\r\n per_fam_id = fam_id AND\r\nper_cls_id = 7\r\norder by c41 desc, per_workphone, per_FirstName', 'Data Jemaat Meninggal', 'Data Jemaat Yang telah Meninggal', 0),
(92, 'select CONCAT(''<a href=PersonView.php?PersonID='',per_ID,''>'',per_FirstName,''</a>'') AS ''Nama '',\r\nCONCAT(''<a href=FamilyView.php?FamilyID='',per_fam_ID,''>'',fam_name,''</a>'') AS ''Keluarga'',\r\nper_workphone as Kelompok,\r\nper_membershipdate as TglDaftar,\r\nper_BirthDay as TGL, per_BirthMonth as BLN, per_BirthYear as TAHUN, \r\nIF (per_Gender=''1'',''L'',''P'') as JnKelamin,\r\nIF(c10=''0000-00-00 00:00:00'',''-'',c10) as TglPindah,\r\nIF(c9 is NULL,''-'',c9) as PindahKe,\r\nIF(c40 is NULL,''-'',c40) as ReffSuratPindah\r\nfrom person_per natural join person_custom, family_fam\r\nwhere\r\n per_fam_id = fam_id AND\r\nper_cls_id = 6\r\norder by per_workphone, per_fmr_id, per_birthYear, per_FirstName', 'Data Jemaat Pindah', 'Data Jemaat yang Pindah dan mengajukan Attestasi Pindah', 0),
(8, 'SELECT \r\n(SELECT per_firstname from person_per where person_per.per_fmr_id = ''1'' AND person_per.per_fam_id = family_fam.fam_id ) as KepalaKeluarga, \r\n(SELECT per_firstname from person_per where person_per.per_fmr_id = ''2'' AND person_per.per_fam_id = family_fam.fam_id ) as NamaPasangan, \r\nfam_WorkPhone as Kelompok, fam_WeddingDate as Tgl_Menikah, c5 as Tempat_Pemberkatan, \r\nc1 as Tgl_CatatanSipil, c2 as TempatCatatanSipil, c3 as Tgl_KUA, c4 as Tempat_KUA \r\nFROM family_fam NATURAL JOIN family_custom \r\nWHERE DATE_FORMAT(fam_WeddingDate, ''%m'') <> '''' ORDER BY DATE_FORMAT(fam_WeddingDate, ''%m''), DATE_FORMAT(fam_WeddingDate, ''%d''), \r\nDATE_FORMAT(fam_WeddingDate, ''%Y'')\r\n', '8. Ulang Tahun Perkawinan', 'Ulang Tahun Perkawinan Keluarga', 0),
(95, 'select CONCAT(''<a href=PersonView.php?PersonID='',per_ID,''>'',per_FirstName,''</a>'') AS ''Nama '',\r\nper_workphone as Kelompok,\r\nIF (per_Gender=''1'',''L'',''P'') as JnKelamin,\r\nper_fmr_ID as StKeluarga,\r\nper_membershipdate as TglDaftar, c8 as TitipanDari,\r\nCONCAT(''<a href=FamilyView.php?FamilyID='',per_fam_ID,''>'',fam_Name,''</a>'') AS ''NmKeluarga ''\r\nfrom person_per natural join person_custom\r\nleft join family_fam ON person_per.per_fam_ID = family_fam.fam_ID\r\nwhere c8 is not null AND per_cls_id = 2 AND\r\nYEAR(per_membershipdate) = ( SELECT YEAR(CURRENT_DATE))\r\norder by per_workphone, per_FirstName', 'Jemaat Titipan Masuk Tahun Ini', 'Jemaat Titipan yang Masuk/Terdaftar  Tahun Ini', 0),
(97, 'select CONCAT(''<a href=PersonView.php?PersonID='',per_ID,''>'',per_FirstName,''</a>'') AS ''Nama '',\r\nCONCAT(''<a href=FamilyView.php?FamilyID='',fam_ID,''>'',fam_Name,''</a>'') AS ''NamaKeluarga'',\r\nper_workphone as Kelompok,\r\nDATE_FORMAT(CONCAT(per_BirthYear,''-'',per_BirthMonth,''-'',per_BirthDay),''%d-%b-%Y'') as TglLahir,\r\nDATE_FORMAT(per_membershipdate,''%d-%b-%Y'') as TglDaftar,\r\nIF (per_Gender=''1'',''L'',''P'') as JnKelamin,\r\nIF(c1=''0000-00-00 00:00:00'',''-'',c1) as TglBaptisAnak,\r\nIF(c26 is NULL,''-'',c26) as TmpBaptisAnak,\r\nIF(c2=''0000-00-00 00:00:00'',''-'',c2) as TglSidhi,\r\nIF(c27 is NULL,''-'',c27) as TmpSidhi, IF(c18=''0000-00-00 00:00:00'',''-'',c18) as TglBaptisDewasa,\r\nIF(c28 is NULL,''-'',c28) as TmpBaptisDewasa\r\nfrom person_per natural join person_custom, family_fam\r\nwhere \r\nperson_per.per_fam_id = family_fam.fam_id AND \r\nYEAR(c1) = ( SELECT YEAR(CURRENT_DATE)) \r\norder by per_workphone, per_FirstName', 'Jemaat yg Baptis Anak Tahun ini', 'Jemaat yg Baptis Anak Tahun ini', 0),
(98, 'select CONCAT(''<a href=PersonView.php?PersonID='',per_ID,''>'',per_FirstName,''</a>'') AS ''Nama '',per_workphone as Kelompok,\r\nper_membershipdate as TglDaftar,\r\nIF (per_Gender=''1'',''L'',''P'') as JnKelamin,\r\nIF(c1=''0000-00-00 00:00:00'',''-'',c1) as TglBaptisAnak,\r\nIF(c26 is NULL,''-'',c26) as TmpBaptisAnak,\r\nIF(c2=''0000-00-00 00:00:00'',''-'',c2) as TglSidhi,\r\nIF(c27 is NULL,''-'',c27) as TmpSidhi, IF(c18=''0000-00-00 00:00:00'',''-'',c18) as TglBaptisDewasa,\r\nIF(c28 is NULL,''-'',c28) as TmpBaptisDewasa\r\nfrom person_per natural join person_custom\r\nwhere\r\nYEAR(c2) = ( SELECT YEAR(CURRENT_DATE)) \r\norder by per_workphone, per_FirstName\r\n', 'Jemaat yang Sidhi Tahun ini', 'Jemaat yang Sidhi Tahun ini', 0),
(99, 'select CONCAT(''<a href=PersonView.php?PersonID='',per_ID,''>'',per_FirstName,''</a>'') AS ''Nama '',per_workphone as Kelompok,\r\nper_membershipdate as TglDaftar,\r\nIF (per_Gender=''1'',''L'',''P'') as JnKelamin,\r\nIF(c1=''0000-00-00 00:00:00'',''-'',c1) as TglBaptisAnak,\r\nIF(c26 is NULL,''-'',c26) as TmpBaptisAnak,\r\nIF(c2=''0000-00-00 00:00:00'',''-'',c2) as TglSidhi,\r\nIF(c27 is NULL,''-'',c27) as TmpSidhi, IF(c18=''0000-00-00 00:00:00'',''-'',c18) as TglBaptisDewasa,\r\nIF(c28 is NULL,''-'',c28) as TmpBaptisDewasa\r\nfrom person_per natural join person_custom\r\nwhere\r\nYEAR(c18) = ( SELECT YEAR(CURRENT_DATE)) \r\norder by per_workphone, per_FirstName\r\n', 'Jemaat yang Baptis Dewasa Tahun ini', 'Jemaat yang Baptis Dewasa Tahun ini', 0),
(168, 'select per_id as Kode, CONCAT(''<a href=PersonView.php?PersonID='',per_ID,''>'',per_FirstName,''</a>'') AS ''Nama '',per_workphone as Kelompok,\r\nper_membershipdate as TglDaftar,\r\nIF (per_Gender=''1'',''L'',''P'') as Gender,\r\nIF (c15=''2'',''Menikah'',''Single'') as Status,\r\nIF(c2=''0000-00-00 00:00:00'',''-'',c2) as TglSidhi,\r\nIF(c27 is NULL,''-'',c27) as TmpSidhi, IF(c18=''0000-00-00 00:00:00'',''-'',c18) as TglBaptisDewasa,\r\nIF(c28 is NULL,''-'',c28) as TmpBaptisDewasa\r\nfrom person_per natural join person_custom \r\nwhere c15 = 1 AND (( (c2 is not NULL AND c2<>''0000-00-00 00:00:00'') \r\nAND c27 is not NULL ) \r\nOR ( (c18 is not NULL AND c18<>''0000-00-00 00:00:00'') AND c28 is not NULL)) \r\norder by per_workphone, per_FirstName', 'Data Warga Dewasa yang belum Menikah', 'Data Warga Dewasa (Sudah Sidhi/Baptis Dewasa) Tapi Belum menikah ', 0),
(93, 'select \r\nCONCAT(''<a href=PersonView.php?PersonID='',per_ID,''>'',per_FirstName,''</a>'') AS ''Nama '',\r\nCONCAT(''<a href=FamilyView.php?FamilyID='',fam_ID,''>'',fam_Name,''</a>'') AS ''NamaKeluarga'',\r\nper_workphone as Kelompok,\r\nDATE_FORMAT(CONCAT(per_BirthYear,''-'',per_BirthMonth,''-'',per_BirthDay),''%d-%b-%Y'')  as TglLahir,\r\nDATE_FORMAT(per_membershipdate,''%d-%b-%Y'') as TglDaftar,\r\n\r\nIF (per_Gender=''1'',''L'',''P'') as JnKelamin,\r\nIF(c1=''0000-00-00 00:00:00'',''-'',DATE_FORMAT(c1,''%d-%b-%Y'')) as TglBaptisAnak,\r\nIF(c26 is NULL,''-'',c26) as TmpBaptisAnak\r\nfrom person_per natural join person_custom, family_fam\r\nwhere\r\nperson_per.per_fam_id = family_fam.fam_id AND \r\nper_BirthYear = ( SELECT YEAR(CURRENT_DATE))\r\norder by per_workphone, per_FirstName', 'Data Jemaat yang Lahir Tahun Ini', 'Data Jemaat yang Lahir Tahun Ini', 0),
(101, 'SELECT CONCAT(''<a href=FamilyView.php?FamilyID='',fam_ID,''>'',fam_Name,''</a>'') AS ''Nama Keluarga'', DATE_FORMAT(fam_weddingdate,''%d-%b-%Y'') as TglNikah, \r\nDATE_FORMAT(NOW(), ''%Y'') - DATE_FORMAT(fam_weddingdate, ''%Y'') - (DATE_FORMAT(NOW(), ''00-%m-%d'') < DATE_FORMAT(fam_weddingdate, ''00-%m-%d'')) AS UmurNikah,\r\nfam_workphone as Kelompok, fam_address1 as Alamat, fam_homephone as Telepon \r\nFROM `family_fam` WHERE `family_fam`.`fam_weddingdate` <> '''' ORDER BY `family_fam`.`fam_weddingdate`  ASC', 'Data Keluarga berdasarkan Umur Pernikahan', 'Data Keluarga diurutkan berdasarkan umur pernikahan ', 0),
(170, 'SELECT WEEK(CONCAT(YEAR(NOW()),''-'',per_BirthMonth,''-'',per_BirthDay),0) as ''Minggu ke'',\r\nper_FirstName AS Nama,\r\nCONCAT(\r\nCASE DAYOFWEEK(CONCAT(YEAR(NOW()),''-'',per_BirthMonth,''-'',per_BirthDay))\r\nWHEN ''1'' THEN ''Minggu''\r\nWHEN ''2'' THEN ''Senin''\r\nWHEN ''3'' THEN ''Selasa''\r\nWHEN ''4'' THEN ''Rabu''\r\nWHEN ''5'' THEN ''Kamis''\r\nWHEN ''6'' THEN ''Jumat''\r\nWHEN ''7'' THEN ''Sabtu''\r\nELSE ''''\r\nEND , '', '',\r\nper_BirthDay,'' '',\r\nlst_OptionName )\r\nas ''Hari & Tanggal'', \r\nCASE per_Workphone \r\nWHEN '' BTRG'' THEN ''Bekasi Timur Regensi''\r\nWHEN '' CBTG'' THEN ''Cibitung''\r\nWHEN '' CKRG'' THEN ''Cikarang''\r\nWHEN '' JTMY'' THEN ''Jatimulya''\r\nWHEN '' KRWG'' THEN ''Karawang''\r\nWHEN '' MGHY'' THEN ''Margahayu''\r\nWHEN '' PRST'' THEN ''Perumnas III''\r\nWHEN '' TMBN'' THEN ''Tambun''\r\nWHEN '' WMJY'' THEN ''Wismajaya''\r\nELSE ''''\r\nEND as Kelompok\r\nFROM person_per , list_lst\r\nWHERE lst_ID=6 AND per_BirthMonth=lst_OptionID AND per_cls_ID<3\r\nORDER BY per_BirthMonth, per_BirthDay, per_WorkPhone', '2.b. Ulang Tahun urut Minggu (utk Warta Gereja)', 'Ulang Tahun diurutkan berdasarkan Mingguan utk Warta Gereja', 0),
(171, 'SELECT WEEK(CONCAT(YEAR(NOW()),''-'',DATE_FORMAT(fam_WeddingDate, ''%m''),''-'',DATE_FORMAT(fam_WeddingDate, ''%d'')),0) as ''Minggu ke'',\r\nCONCAT(\r\n(SELECT per_firstname from person_per where person_per.per_fmr_id = ''1'' AND person_per.per_fam_id = family_fam.fam_id AND per_cls_ID<3),'' - '',\r\n(SELECT per_firstname from person_per where person_per.per_fmr_id = ''2'' AND person_per.per_fam_id = family_fam.fam_id AND per_cls_ID<3)) as ''Nama Keluarga'',\r\nCONCAT(\r\nCASE DAYOFWEEK(CONCAT(YEAR(NOW()),''-'',DATE_FORMAT(fam_WeddingDate, ''%m''),''-'',DATE_FORMAT(fam_WeddingDate, ''%d'')))\r\nWHEN ''1'' THEN ''Minggu''\r\nWHEN ''2'' THEN ''Senin''\r\nWHEN ''3'' THEN ''Selasa''\r\nWHEN ''4'' THEN ''Rabu''\r\nWHEN ''5'' THEN ''Kamis''\r\nWHEN ''6'' THEN ''Jumat''\r\nWHEN ''7'' THEN ''Sabtu''\r\nELSE ''''\r\nEND , '', '',\r\nDATE_FORMAT(fam_WeddingDate, ''%d''),'' '',\r\nlst_OptionName )\r\nas ''Hari & Tanggal'',\r\nCASE fam_Workphone\r\nWHEN ''BTRG'' THEN ''Bekasi Timur Regensi''\r\nWHEN ''CBTG'' THEN ''Cibitung''\r\nWHEN ''CKRG'' THEN ''Cikarang''\r\nWHEN ''JTMY'' THEN ''Jatimulya''\r\nWHEN ''KRWG'' THEN ''Karawang''\r\nWHEN ''MGHY'' THEN ''Margahayu''\r\nWHEN ''PRST'' THEN ''Perumnas III''\r\nWHEN ''TMBN'' THEN ''Tambun''\r\nWHEN ''WMJY'' THEN ''Wismajaya''\r\nELSE ''''\r\nEND as Kelompok\r\nFROM family_fam NATURAL JOIN family_custom , list_lst \r\nWHERE (lst_ID=6 AND DATE_FORMAT(fam_WeddingDate, ''%m'')=lst_OptionID) AND \r\nDATE_FORMAT(fam_WeddingDate, ''%m'') <> '''' AND \r\n(\r\n(SELECT per_firstname from person_per where person_per.per_fmr_id = ''1'' AND person_per.per_fam_id = family_fam.fam_id AND per_cls_ID<3) <> ''''\r\nAND\r\n(SELECT per_firstname from person_per where person_per.per_fmr_id = ''2'' AND person_per.per_fam_id = family_fam.fam_id AND per_cls_ID<3)  <> ''''\r\n)\r\n\r\nORDER BY DATE_FORMAT(fam_WeddingDate, ''%m''), DATE_FORMAT(fam_WeddingDate, ''%d''),\r\nDATE_FORMAT(fam_WeddingDate, ''%Y'')', '2.c. Ulang Tahun Perkawinan urut minggu (Untuk Warta Gereja)', 'Ulang Tahun Perkawinan diurutkan berdasarkan Mingguan utk Warta Gereja', 0),
(172, 'SELECT WEEK(CONCAT(YEAR(NOW()),''-'',per_BirthMonth,''-'',per_BirthDay),0) as ''Mingguke'',\r\nper_FirstName AS Nama,\r\nCONCAT(\r\nCASE DAYOFWEEK(CONCAT(YEAR(NOW()),''-'',per_BirthMonth,''-'',per_BirthDay))\r\nWHEN ''1'' THEN ''Minggu''\r\nWHEN ''2'' THEN ''Senin''\r\nWHEN ''3'' THEN ''Selasa''\r\nWHEN ''4'' THEN ''Rabu''\r\nWHEN ''5'' THEN ''Kamis''\r\nWHEN ''6'' THEN ''Jumat''\r\nWHEN ''7'' THEN ''Sabtu''\r\nELSE ''''\r\nEND , '', '',\r\nper_BirthDay,'' '',\r\nlst_OptionName )\r\nas ''Hari & Tanggal'', \r\nc.grp_Description as Kelompok\r\nFROM person_per a \r\nLEFT JOIN list_lst b ON a.per_BirthMonth=b.lst_OptionID \r\nLEFT JOIN group_grp c ON trim(a.per_WorkPhone) = c.grp_Name\r\nWHERE\r\nWEEK(CONCAT(YEAR(NOW()),''-'',per_BirthMonth,''-'',per_BirthDay),0)=week(now())+1\r\nAND lst_ID=6 AND per_cls_ID<3\r\nORDER BY per_BirthMonth, per_BirthDay, per_WorkPhone', '2.a. Ulang Tahun se-Minggu (utk Warta Gereja)', 'Daftar Jemaat yang ber-Ulang Tahun Minggu ini (utk Warta Gereja)', 0),
(45, 'SELECT\r\nCONCAT(''<a href=PersonView.php?PersonID='',per_ID,''>'',per_FirstName,''</a>'') AS ''Nama'',\r\nCONCAT(per_birthday,''/'',per_birthmonth,''/'',per_birthyear) AS TglLahir, IF (per_gender=1,''Lakilaki'',''Perempuan'') AS JenisKelamin, \r\nCONCAT(''<a href=FamilyView.php?FamilyID='',per_fam_ID,''>'',b.fam_Name,''</a>'') AS ''NamaKeluarga'',\r\nper_DateLastEdited as "TGL Edit",\r\nper_DateEntered "TGL Input",\r\nper_EnteredBy as "DiInput oleh",\r\nper_EditedBy as "DiEdit oleh"\r\nFROM person_per a \r\nLEFT JOIN family_fam b ON a.per_fam_ID = b.fam_ID\r\nWHERE per_Firstname IN (\r\nSELECT per_FirstName FROM person_per\r\nGROUP BY per_FirstName\r\nHAVING count(per_FirstName) > 1\r\n)\r\n\r\nORDER BY per_FirstName, per_EnteredBy', '<font color="red"> Error - Data Duplicate</font>', 'Datawarga yang kemungkinan tidak valid/kembar', 0),
(175, 'select CONCAT(''<a href=PersonView.php?PersonID='',a.per_ID,''>'',a.per_FirstName,''</a>'') AS ''Nama '',\r\nfam_homephone as TelpRumah, c13 as TelpKantor, per_cellphone as Handphone, per_email as Email, vol_name as Jabatan, per_workphone as Kelompok\r\nfrom person_per a, person_custom b, family_fam, person2volunteeropp_p2vo, volunteeropportunity_vol\r\nwhere a.per_id = b.per_id AND\r\na.per_id = p2vo_per_id AND p2vo_vol_id = vol_id AND per_fam_id = fam_id\r\nAND vol_id = 200\r\nORDER by vol_id, per_workphone, per_firstname', '<font color="green">Pokja Multimedia</font>', 'Kelompok Kerja Multimedia', 0),
(176, 'select CONCAT(''<a href=PersonView.php?PersonID='',a.per_ID,''>'',a.per_FirstName,''</a>'') AS ''Nama '',\r\nfam_homephone as TelpRumah, c13 as TelpKantor, per_cellphone as Handphone, per_email as Email, vol_name as Jabatan, per_workphone as Kelompok\r\nfrom person_per a, person_custom b, family_fam, person2volunteeropp_p2vo, volunteeropportunity_vol\r\nwhere a.per_id = b.per_id AND\r\na.per_id = p2vo_per_id AND p2vo_vol_id = vol_id AND per_fam_id = fam_id\r\nAND vol_id = 201\r\nORDER by vol_id, per_workphone, per_firstname', '<font color="green">Pengajar PAK</font>', 'Pengajar Pendidikan Agama Kristen', 0),
(177, 'select CONCAT(''<a href=PersonView.php?PersonID='',a.per_ID,''>'',a.per_FirstName,''</a>'') AS ''Nama '',\r\nfam_homephone as TelpRumah, c13 as TelpKantor, per_cellphone as Handphone, per_email as Email, vol_name as Jabatan, per_workphone as Kelompok\r\nfrom person_per a, person_custom b, family_fam, person2volunteeropp_p2vo, volunteeropportunity_vol\r\nwhere a.per_id = b.per_id AND\r\na.per_id = p2vo_per_id AND p2vo_vol_id = vol_id AND per_fam_id = fam_id\r\nAND vol_id = 202\r\nORDER by vol_id, per_workphone, per_firstname', '<font color="green">Pengajar Sekolah Minggu</font>', 'Pengajar Sekolah Minggu', 0),
(178, 'select CONCAT(''<a href=PersonView.php?PersonID='',a.per_ID,''>'',a.per_FirstName,''</a>'') AS ''Nama '',\r\nfam_homephone as TelpRumah, c13 as TelpKantor, per_cellphone as Handphone, per_email as Email, vol_name as Jabatan, per_workphone as Kelompok\r\nfrom person_per a \r\nleft join person_custom b ON a.per_ID = b.per_ID \r\nleft join family_fam c ON c.fam_ID = a.per_fam_ID,\r\nperson2volunteeropp_p2vo, volunteeropportunity_vol\r\nwhere \r\na.per_id = p2vo_per_id AND p2vo_vol_id = vol_id \r\nAND vol_id = 203\r\nORDER by vol_id, per_workphone, per_firstname', '<font color="green">Pemusik / Organis</font>', 'Pemusik / Organis', 0),
(179, 'select CONCAT(''<a href=PersonView.php?PersonID='',a.per_ID,''>'',a.per_FirstName,''</a>'') AS ''Nama '',\r\nfam_homephone as TelpRumah, c13 as TelpKantor, per_cellphone as Handphone, per_email as Email, vol_name as Jabatan, per_workphone as Kelompok\r\nfrom person_per a, person_custom b, family_fam, person2volunteeropp_p2vo, volunteeropportunity_vol\r\nwhere a.per_id = b.per_id AND\r\na.per_id = p2vo_per_id AND p2vo_vol_id = vol_id AND per_fam_id = fam_id\r\nAND vol_id = 204\r\nORDER by vol_id, per_workphone, per_firstname', '<font color="green">Song Leader</font>', 'Pemimpin Nyanyian / Song leader', 0),
(180, 'select CONCAT(''<a href=PersonView.php?PersonID='',a.per_ID,''>'',a.per_FirstName,''</a>'') AS ''Nama '',\r\nfam_homephone as TelpRumah, c13 as TelpKantor, per_cellphone as Handphone, per_email as Email, vol_name as Jabatan, per_workphone as Kelompok\r\nfrom person_per a, person_custom b, family_fam, person2volunteeropp_p2vo, volunteeropportunity_vol\r\nwhere a.per_id = b.per_id AND\r\na.per_id = p2vo_per_id AND p2vo_vol_id = vol_id AND per_fam_id = fam_id\r\nAND vol_id = 205\r\nORDER by vol_id, per_workphone, per_firstname', '<font color="green">Tim Musik SM/Remaja/Pemuda</font>', 'Tim Musik SM/Remaja/Pemuda', 0),
(181, 'select CONCAT(''<a href=PersonView.php?PersonID='',a.per_ID,''>'',a.per_FirstName,''</a>'') AS ''Nama '',\r\nfam_homephone as TelpRumah, c13 as TelpKantor, per_cellphone as Handphone, per_email as Email, vol_name as Jabatan, per_workphone as Kelompok\r\nfrom person_per a, person_custom b, family_fam, person2volunteeropp_p2vo, volunteeropportunity_vol\r\nwhere a.per_id = b.per_id AND\r\na.per_id = p2vo_per_id AND p2vo_vol_id = vol_id AND per_fam_id = fam_id\r\nAND vol_id = 206\r\nORDER by vol_id, per_workphone, per_firstname', '<font color="green">Tim MC</font>', 'Tim MC/PembawaAcara', 0),
(200, 'SELECT CONCAT(''<a href=PelayanFirmanEditor.php?PelayanFirmanID='',a.PelayanFirmanID,''>'',a.PelayanFirmanID,''</a>'') AS ''ID'',\r\n IF(a.PelayanFirman>0, d.NamaPendeta , a.PFnonInstitusi) as Pengkotbah ,\r\nIF(a.PelayanFirman>0, e.NamaGereja , a.PFNIAlamat ) as Alamat,\r\n\r\ncount(IF(a.PelayanFirman>0, d.NamaPendeta , a.PFnonInstitusi)) as JumlahKunjungan\r\nFROM JadwalPelayanFirman a\r\nLEFT JOIN LokasiTI b ON a.KodeTI=b.KodeTI\r\nLEFT JOIN DaftarPendeta d ON a.PelayanFirman = d.PendetaID\r\nLEFT JOIN DaftarGerejaGKJ e ON d.GerejaID= e.GerejaID\r\n\r\nWHERE a.KodeTI = b.KodeTI\r\nAND YEAR(a.TanggalPF) = YEAR(CURDATE())\r\nGROUP BY Pengkotbah\r\nORDER BY Pengkotbah ', 'Daftar Kunjungan Pelayan Firman', 'Daftar Kunjungan Pelayan Firman', 0);
INSERT INTO `query_qry_asli` (`qry_ID`, `qry_SQL`, `qry_Name`, `qry_Description`, `qry_Count`) VALUES
(2, 'SELECT COUNT(per_ID)\r\nAS ''Jumlah''\r\nFROM person_per', 'Person Count', 'Returns the total number of people in the database.', 0),
(3, 'SELECT CONCAT(''<a href=FamilyView.php?FamilyID='',fam_ID,''>'',fam_Name,''</a>'') AS ''Nama Keluarga'', COUNT(*) AS ''Jumlah.''\r\nFROM person_per\r\nINNER JOIN family_fam\r\nON fam_ID = per_fam_ID\r\nGROUP BY per_fam_ID\r\nORDER BY ''No.'' DESC', '3. Jumlah Jiwa Dalam Keluarga', 'Data Jumlah Jiwa yang terdaftar dalam suatu Keluarga', 0),
(4, 'SELECT per_ID as AddToCart,CONCAT(''<a\r\nhref=PersonView.php?PersonID='',per_ID,''>'',per_FirstName,'' '',per_MiddleName,'' '',per_LastName,''</a>'') AS Nama,\r\nCONCAT(per_BirthDay,''/'',per_BirthMonth,''/'',per_BirthYear) AS ''Tanggal Lahir'',\r\nYEAR(CURRENT_DATE) - per_BirthYear - 1 AS ''Umur''\r\nFROM person_per\r\nWHERE\r\nDATE_ADD(CONCAT(per_BirthYear,''-'',per_BirthMonth,''-'',per_BirthDay),INTERVAL\r\n~min~ YEAR) <= CURDATE()\r\nAND\r\nDATE_ADD(CONCAT(per_BirthYear,''-'',per_BirthMonth,''-'',per_BirthDay),INTERVAL\r\n(~max~ + 1) YEAR) >= CURDATE()', '4. Jemaat Berdasarkan Rentang Umur', 'Menampilkan Data Jemaat Berdasarkan Rentang Umur', 1),
(6, 'SELECT COUNT(per_ID) AS Total FROM person_per WHERE per_Gender = ~gender~', 'Total By Gender', 'Total of records matching a given gender.', 0),
(7, 'SELECT per_ID as AddToCart, CONCAT(per_FirstName,'' '',per_MiddleName,'' '',per_LastName) AS Nama FROM person_per WHERE per_fmr_ID = ~role~ AND per_Gender = ~gender~', '5. Jemaat Berdasarkan Peran dan Jenis Kelamin', 'Data Jemaat berdasarkan Peran dalam Keluarga dan Jenis Kelamin', 1),
(9, 'SELECT \r\nper_ID as AddToCart, \r\nCONCAT(per_FirstName,'' '',per_LastName) AS Name, \r\nCONCAT(r2p_Value,'' '') AS Value\r\nFROM person_per,record2property_r2p\r\nWHERE per_ID = r2p_record_ID\r\nAND r2p_pro_ID = ~PropertyID~\r\nORDER BY per_LastName', 'Person by Property', 'Returns person records which are assigned the given property.', 1),
(15, 'SELECT per_ID as AddToCart, CONCAT(''<a href=PersonView.php?PersonID='',per_ID,''>'',per_FirstName,'' '',per_MiddleName,'' '',per_LastName,''</a>'') AS Name, fam_City as City, fam_State as State, fam_Zip as ZIP, per_HomePhone as HomePhone, per_Email as Email, per_WorkEmail as WorkEmail FROM person_per RIGHT JOIN family_fam ON family_fam.fam_id = person_per.per_fam_id WHERE ~searchwhat~ LIKE ''%~searchstring~%''', '1. Lacak', 'Mencari data berdasarkan Nama, Kota, Daerah, Kode POS, Telepon Rumah, Email atau tempat lahir\r\n', 1),
(16, 'SELECT per_ID as AddToCart, CONCAT(''<a href=PersonView.php?PersonID='',per_ID,''>'',per_FirstName,'' '',per_LastName,''</a>'') AS Name FROM person_per LEFT JOIN person2group2role_p2g2r ON per_id = p2g2r_per_ID LEFT JOIN group_grp a ON grp_ID = p2g2r_grp_ID LEFT JOIN list_lst b ON lst_ID = grp_RoleListID AND p2g2r_rle_ID = lst_OptionID WHERE lst_OptionName = ''Teacher''', 'Find Teachers', 'Find all people assigned to Sunday school classes as teachers', 1),
(17, 'SELECT per_ID as AddToCart, CONCAT(''<a href=PersonView.php?PersonID='',per_ID,''>'',per_FirstName,'' '',per_LastName,''</a>'') AS Name FROM person_per LEFT JOIN person2group2role_p2g2r ON per_id = p2g2r_per_ID LEFT JOIN group_grp a ON grp_ID = p2g2r_grp_ID LEFT JOIN list_lst b ON lst_ID = grp_RoleListID AND p2g2r_rle_ID = lst_OptionID WHERE lst_OptionName = ''Student''', 'Find Students', 'Find all people assigned to Sunday school classes as students', 1),
(18, 'SELECT per_ID as AddToCart, per_BirthDay as Day, CONCAT(per_FirstName,'' '',per_LastName) AS Name FROM person_per WHERE per_cls_ID=1 AND per_BirthMonth=~birthmonth~ ORDER BY per_BirthDay', '2. Ulang Tahun', 'Jemaat yang berulang Tahun pada bulan spesifik', 0),
(19, 'SELECT per_ID as AddToCart, CONCAT(''<a href=PersonView.php?PersonID='',per_ID,''>'',per_FirstName,'' '',per_LastName,''</a>'') AS Name FROM person_per LEFT JOIN person2group2role_p2g2r ON per_id = p2g2r_per_ID LEFT JOIN group_grp a ON grp_ID = p2g2r_grp_ID LEFT JOIN list_lst b ON lst_ID = grp_RoleListID AND p2g2r_rle_ID = lst_OptionID WHERE lst_OptionName = ''Student'' AND grp_ID = ~group~ ORDER BY per_LastName', 'Class Students', 'Find students for a particular class', 1),
(20, 'SELECT per_ID as AddToCart, CONCAT(''<a href=PersonView.php?PersonID='',per_ID,''>'',per_FirstName,'' '',per_LastName,''</a>'') AS Name FROM person_per LEFT JOIN person2group2role_p2g2r ON per_id = p2g2r_per_ID LEFT JOIN group_grp a ON grp_ID = p2g2r_grp_ID LEFT JOIN list_lst b ON lst_ID = grp_RoleListID AND p2g2r_rle_ID = lst_OptionID WHERE lst_OptionName = ''Teacher'' AND grp_ID = ~group~ ORDER BY per_LastName', 'Class Teachers', 'Find teachers for a particular class', 1),
(21, 'SELECT per_ID as AddToCart, CONCAT(''<a href=PersonView.php?PersonID='',per_ID,''>'',per_FirstName,'' '',per_LastName,''</a>'') AS Name FROM person_per LEFT JOIN person2group2role_p2g2r ON per_id = p2g2r_per_ID WHERE p2g2r_grp_ID=~group~ ORDER BY per_LastName', 'Registered students', 'Find Registered students', 1),
(22, 'SELECT per_ID as AddToCart, DAYOFMONTH(per_MembershipDate) as Day, per_MembershipDate AS DATE, CONCAT(per_FirstName,'' '',per_LastName) AS Name FROM person_per WHERE per_cls_ID=1 AND MONTH(per_MembershipDate)=~membermonth~ ORDER BY per_MembershipDate', 'Membership anniversaries', 'Members who joined in a particular month', 0),
(23, 'SELECT usr_per_ID as AddToCart, CONCAT(a.per_FirstName,'' '',a.per_LastName) AS Name FROM user_usr LEFT JOIN person_per a ON per_ID=usr_per_ID ORDER BY per_LastName', 'Select database users', 'People who are registered as database users', 0),
(24, 'SELECT per_ID as AddToCart, CONCAT(''<a href=PersonView.php?PersonID='',per_ID,''>'',per_FirstName,'' '',per_LastName,''</a>'') AS Name FROM person_per WHERE per_cls_id =1', 'Select all members', 'People who are members', 0),
(25, 'SELECT per_ID as AddToCart, CONCAT(''<a href=PersonView.php?PersonID='',per_ID,''>'',per_FirstName,'' '',per_LastName,''</a>'') AS Name FROM person_per LEFT JOIN person2volunteeropp_p2vo ON per_id = p2vo_per_ID WHERE p2vo_vol_ID = ~volopp~ ORDER BY per_LastName', 'Volunteers', 'Find volunteers for a particular opportunity', 1),
(26, 'SELECT per_ID as AddToCart, CONCAT(per_FirstName,'' '',per_LastName) AS Name FROM person_per WHERE DATE_SUB(NOW(),INTERVAL ~friendmonths~ MONTH)<per_FriendDate ORDER BY per_MembershipDate', 'Recent friends', 'Friends who signed up in previous months', 0),
(27, 'SELECT per_ID as AddToCart, CONCAT(per_FirstName,'' '',per_LastName) AS Name FROM person_per inner join family_fam on per_fam_ID=fam_ID where per_fmr_ID<>3 AND fam_OkToCanvass="TRUE" ORDER BY fam_Zip', 'Families to Canvass', 'People in families that are ok to canvass.', 0),
(28, 'SELECT fam_Name, a.plg_amount as PlgFY1, b.plg_amount as PlgFY2 from family_fam left join pledge_plg a on a.plg_famID = fam_ID and a.plg_FYID=~fyid1~ and a.plg_PledgeOrPayment=''Pledge'' left join pledge_plg b on b.plg_famID = fam_ID and b.plg_FYID=~fyid2~ and b.plg_PledgeOrPayment=''Pledge'' order by fam_Name', 'Pledge comparison', 'Compare pledges between two fiscal years', 1),
(30, 'SELECT per_ID as AddToCart, CONCAT(per_FirstName,'' '',per_LastName) AS Name, fam_address1, fam_city, fam_state, fam_zip FROM person_per join family_fam on per_fam_id=fam_id where per_fmr_id<>3 and per_fam_id in (select fam_id from family_fam inner join pledge_plg a on a.plg_famID=fam_ID and a.plg_FYID=~fyid1~ and a.plg_amount>0) and per_fam_id not in (select fam_id from family_fam inner join pledge_plg b on b.plg_famID=fam_ID and b.plg_FYID=~fyid2~ and b.plg_amount>0)', 'Missing pledges', 'Find people who pledged one year but not another', 1),
(31, 'select per_ID as AddToCart, per_FirstName, per_LastName, per_email from person_per, autopayment_aut where aut_famID=per_fam_ID and aut_CreditCard!="" and per_email!="" and (per_fmr_ID=1 or per_fmr_ID=2 or per_cls_ID=1)', 'Credit Cart People', 'People who are configured to pay by credit card.', 0),
(100, 'SELECT a.per_ID as AddToCart, CONCAT(''<a href=PersonView.php?PersonID='',a.per_ID,''>'',a.per_FirstName,'' '',a.per_LastName,''</a>'') AS Name FROM person_per AS a LEFT JOIN person2volunteeropp_p2vo p2v1 ON (a.per_id = p2v1.p2vo_per_ID AND p2v1.p2vo_vol_ID = ~volopp1~) LEFT JOIN person2volunteeropp_p2vo p2v2 ON (a.per_id = p2v2.p2vo_per_ID AND p2v2.p2vo_vol_ID = ~volopp2~) WHERE p2v1.p2vo_per_ID=p2v2.p2vo_per_ID ORDER BY per_LastName', 'Volunteers', 'Find volunteers for who match two specific opportunity codes', 1),
(51, 'select b.grp_name as Kelompok, count(a.p2g2r_grp_id) as Anggota  from person2group2role_p2g2r a, group_grp b, person_per c\r\nwhere a.p2g2r_grp_id = b.grp_id AND a.p2g2r_per_id = c.per_ID\r\ngroup by b.grp_id order by b.grp_id', 'Jumlah Anggota Dalam Kelompok', 'Menghitung Jumlah Anggota dalam Kelompok', 0);
